            <h2>Our Story</h2>
            
            <p>Rebalance was founded by Emma Rusiti. Emma studied psychology and is driven by her desire to help people. Over the last 10 years yoga has become her passion. Having experienced the transformational impact yoga and breathwork techniques had on her mental and emotional wellbeing, Emma went on to dedicate extensive time studying these practices across the world. However in 2015, she experienced the loss of a family member to suicide. This highlighted to her the importance and necessity of taking time to invest in our mental health regularly, and planted the seed for Rebalance.</p> 

            <h2>Rebalance Your Work Day</h2>

            <p>Rebalance was developed as an online tool that would enable the benefits of yoga, mindful movement and breathwork practices to be experienced by those who need it most: busy, working professionals. It aims to help users connect to themselves by offering approachable movement and breathing exercises that can be incorporated into the workday, allowing individuals to press pause in their otherwise busy day. Using just a few minutes of your time, we aim to give you a tool to help you look after yourself, unwind some tension, improve your mood, and increase your productivity and focus. By doing so, we aim to help organisations support their employees in taking a mindful break during the day to improve their mental, emotional and physical wellbeing.</p>

